const numberFormats = {
  en: {
    currency: { style: "currency", currency: "USD" }
  },
  ru: {
    currency: { style: "currency", currency: "RUB" }
  },
  ch: {
    currency: { style: "currency", currency: "CNY", currencyDisplay: "code" }
  }
};

export default numberFormats;
